column4:
Confession time. I did not believe all the FSD hype from X users like 
@WholeMarsBlog
@AIDRIVR
@DirtyTesLa
 and even 
@elonmusk
.
I was wrong.
I picked Talos up Monday. I did not "drive" Talos for the first 50 miles. I pulled out of Tesla Delivery with FSD engaged and had a flawless drive on a diverse route including two-lane, divided 4 lane, highways, exit ramp construction, stop lights, stop signs, unprotected left turns, right turns on red... I did a few more trips and then back home all with FSD. My first 50 miles, all FSD, no disengagements. Then my few trips Tuesday were mostly the same.
FSD far exceeds my expectations. 97 of my first 100 miles were with FSD. I had only one safety disengagement, a judgement call where I braked after a right lane change behind a car with much less gap than I am used to. I drove 3 miles with FSD turned off just to see how the car felt and handled when pushed. I also wanted to experience maximum acceleration which is a hoot. There is only one other situation my wife uses that word!
More posts and videos to come.

